    "ex_animation_preview": {                         "en": "Here you only set the Animation properties.<br>All colors will be defined for each element!", "de": "Hier legen Sie nur die Animationseigenschaften fest.<br>Alle Farben werden für jedes Element definiert!", "ru": "Здесь вы устанавливаете только свойства анимации.<br>Все цвета будут определены для каждого элемента!", "pt": "Aqui você define apenas as propriedades da Animação.<br>Todas as cores serão definidas para cada elemento!", "nl": "Hier stelt u alleen de animatie-eigenschappen in.<br>Alle kleuren worden voor elk element gedefinieerd!", "fr": "Ici, vous définissez uniquement les propriétés d'animation.<br>Toutes les couleurs seront définies pour chaque élément !", "it": "Qui imposti solo le proprietà dell'animazione.<br>Tutti i colori saranno definiti per ogni elemento!", "es": "Aquí solo establece las propiedades de Animación.<br>¡Todos los colores se definirán para cada elemento!", "pl": "Tutaj ustawiasz tylko właściwości animacji.<br>Wszystkie kolory zostaną zdefiniowane dla każdego elementu!", "uk": "Тут ви лише встановлюєте властивості анімації.<br>Усі кольори будуть визначені для кожного елемента!", "zh-cn": "这里您只需设置动画属性。<br>将为每个元素定义所有颜色！"},
    "ex_battery_help": {                              "en": "<u>Info:</u> After filling in all necessary values, the remaining battery-time will appear in the Datapoint <code>energiefluss.Instance-No#.calculation.battery.battery_remaining</code>, which can be added via Datasources. <br><u>Please note:</u> The time shows both directions - the time for charging, if it is charging and the time for discharging, if it is discharging", "de": "<u>Info:</u> Nach dem Ausfüllen aller notwendigen Werte erscheint die verbleibende Batterielaufzeit im Datenpunkt <code>energiefluss.Instance-No#.battery_remaining</code>, der über Datenquellen hinzugefügt werden kann. <br><u>Bitte beachten Sie:</u> Die Zeit zeigt beide Richtungen an – die Ladezeit, wenn geladen wird, und die Entladezeit, wenn entladen wird", "ru": "<u>Информация:</u> После заполнения всех необходимых значений оставшееся время работы от батареи появится в точке данных <code>energiefluss.Instance-No#.battery_remaining</code>, которую можно добавить через источники данных. <br><u>Обратите внимание:</u> время показывает оба направления - время зарядки, если оно заряжается, и время разрядки, если оно разряжается.", "pt": "<u>Informação:</u> Após preencher todos os valores necessários, o tempo restante da bateria aparecerá no Datapoint <code>energiefluss.Instance-No#.battery_remaining</code>, que pode ser adicionado via Datasources. <br><u>Observação:</u> A hora mostra as duas direções - a hora de carregar, se estiver carregando e a hora de descarregar, se estiver descarregando", "nl": "<u>Info:</u> Nadat alle benodigde waarden zijn ingevuld, verschijnt de resterende batterijduur in het Datapoint <code>energiefluss.Instance-No#.battery_remaining</code>, dat kan worden toegevoegd via Datasources. <br><u>Let op:</u> de tijd toont beide richtingen - de tijd voor opladen, als hij aan het opladen is en de tijd voor ontladen, als hij aan het ontladen is", "fr": "<u>Info :</u> Après avoir rempli toutes les valeurs nécessaires, l'autonomie restante de la batterie apparaîtra dans le point de données <code>energiefluss.Instance-No#.battery_remaining</code>, qui peut être ajouté via les sources de données. <br><u>Veuillez noter :</u> L'heure indique les deux sens - le temps de charge, s'il est en charge et le temps de décharge, s'il est en train de se décharger", "it": "<u>Informazioni:</u> Dopo aver inserito tutti i valori necessari, la durata residua della batteria verrà visualizzata nel Datapoint <code>energiefluss.Instance-No#.battery_remaining</code>, che può essere aggiunto tramite Datasources. <br><u>Nota:</u> L'ora mostra entrambe le direzioni: il tempo di ricarica, se è in carica e il tempo di scarica, se si sta scaricando", "es": "<u>Información:</u> Después de completar todos los valores necesarios, el tiempo restante de la batería aparecerá en el Punto de datos <code>energiefluss.Instance-No#.battery_remaining</code>, que se puede agregar a través de Datasources. <br><u>Tenga en cuenta:</u> La hora muestra ambas direcciones: la hora de carga, si se está cargando, y la hora de descarga, si se está descargando", "pl": "<u>Informacje:</u> Po wprowadzeniu wszystkich niezbędnych wartości pozostały czas pracy na baterii pojawi się w punkcie danych <code>energiefluss.Instance-No#.battery_remaining</code>, który można dodać za pomocą źródeł danych. <br><u>Uwaga:</u> Czas pokazuje oba kierunki - czas ładowania, jeśli jest ładowany, i czas rozładowania, jeśli się rozładowuje", "uk": "<u>Інформація:</u> після заповнення всіх необхідних значень час роботи акумулятора, що залишився, з’явиться в точці даних <code>energiefluss.Instance-No#.battery_remaining</code>, яку можна додати через джерела даних. <br><u>Зверніть увагу:</u> час показує обидва напрямки - час заряджання, якщо він заряджається, і час розряджання, якщо він розряджається", "zh-cn": "<u>信息：</u>填写所有必要的值后，剩余电池时间将显示在数据点<code>energiefluss.Instance-No#.battery_remaining</code>中，可以通过数据源添加。 <br><u>请注意：</u>时间显示两个方向 - 如果正在充电，则显示充电时间；如果正在放电，则显示放电时间"},
