    "ex_coordinates": {                               "en": "These coordinates (+ random number between 0 and 50) will be used as a starting value when adding a new element.", "de": "Diese Koordinaten (+ Zufallszahl zwischen 0 und 50) werden beim Hinzufügen eines neuen Elements als Startwert verwendet.", "ru": "Эти координаты (+ случайное число от 0 до 50) будут использоваться в качестве начального значения при добавлении нового элемента.", "pt": "Essas coordenadas (+ número aleatório entre 0 e 50) serão usadas como valor inicial ao adicionar um novo elemento.", "nl": "Deze coördinaten (+ willekeurig getal tussen 0 en 50) worden gebruikt als startwaarde bij het toevoegen van een nieuw element.", "fr": "Ces coordonnées (+ nombre aléatoire entre 0 et 50) seront utilisées comme valeur de départ lors de l'ajout d'un nouvel élément.", "it": "Queste coordinate (+ numero casuale compreso tra 0 e 50) verranno utilizzate come valore iniziale quando si aggiunge un nuovo elemento.", "es": "Estas coordenadas (+ número aleatorio entre 0 y 50) se utilizarán como valor inicial al agregar un nuevo elemento.", "pl": "Te współrzędne (+ liczba losowa z przedziału od 0 do 50) będą używane jako wartość początkowa podczas dodawania nowego elementu.", "uk": "Ці координати (+ випадкове число від 0 до 50) використовуватимуться як початкове значення під час додавання нового елемента.", "zh-cn": "这些坐标（+ 0 到 50 之间的随机数）将在添加新元素时用作起始值。"},
    "ex_coordinates_info": {                          "en": "<b><u>Please note</u></b>: For the changes to take effect, you need to save them!", "de": "<b><u>Bitte beachten Sie</u></b>: Damit die Änderungen wirksam werden, müssen Sie sie speichern!", "ru": "<b><u>Обратите внимание</u></b>. Чтобы изменения вступили в силу, их необходимо сохранить!", "pt": "<b><u>Observação</u></b>: Para que as alterações entrem em vigor, você precisa salvá-las!", "nl": "<b><u>Let op</u></b>: om de wijzigingen door te voeren, moet u ze opslaan!", "fr": "<b><u>Veuillez noter</u></b> : Pour que les modifications prennent effet, vous devez les enregistrer !", "it": "<b><u>Nota</u></b>: affinché le modifiche abbiano effetto, è necessario salvarle!", "es": "<b><u>Tenga en cuenta</u></b>: ¡Para que los cambios surtan efecto, debe guardarlos!", "pl": "<b><u>Uwaga</u></b>: aby zmiany odniosły skutek, musisz je zapisać!", "uk": "<b><u>Зверніть увагу</u></b>: щоб зміни набули чинності, їх потрібно зберегти!", "zh-cn": "<b><u>请注意</u></b>：为了使更改生效，您需要保存它们！"},
