    "failmsg_failed_config": {                        "en": "Failed to load the basic configuration!<br>Adapter may be corrupted!", "de": "Die Grundkonfiguration konnte nicht geladen werden!<br>Der Adapter ist möglicherweise beschädigt!", "ru": "Не удалось загрузить базовую конфигурацию!<br>Возможно, поврежден адаптер!", "pt": "Falha ao carregar a configuração básica!<br>O adaptador pode estar corrompido!", "nl": "Kan de basisconfiguratie niet laden!<br>Adapter is mogelijk beschadigd!", "fr": "Échec du chargement de la configuration de base !<br>L'adaptateur est peut-être corrompu !", "it": "Impossibile caricare la configurazione di base!<br>L'adattatore potrebbe essere danneggiato!", "es": "¡Error al cargar la configuración básica!<br>¡El adaptador puede estar dañado!", "pl": "Nie udało się załadować podstawowej konfiguracji!<br>Adapter może być uszkodzony!", "uk": "Не вдалося завантажити базову конфігурацію!<br>Адаптер може бути пошкоджений!", "zh-cn": "无法加载基本配置！<br>适配器可能已损坏！"},
