    "ex_consumption_help": {                          "en": "<u>Info:</u> After filling in all necessary values, the consumption will appear in the Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, which can be added via Datasources.", "de": "<u>Info:</u> Nach dem Ausfüllen aller notwendigen Werte erscheint der Verbrauch im Datenpunkt <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, der über Datenquellen hinzugefügt werden kann.", "ru": "<u>Информация:</u> После заполнения всех необходимых значений потребление появится в точке данных <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, которую можно добавить через Источники данных.", "pt": "<u>Info:</u> Após preencher todos os valores necessários, o consumo aparecerá no Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, que pode ser adicionado via Datasources.", "nl": "<u>Info:</u> Na het invullen van alle benodigde waarden verschijnt het verbruik in het Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, dat kan worden toegevoegd via Databronnen.", "fr": "<u>Info :</u> Après avoir renseigné toutes les valeurs nécessaires, la consommation apparaîtra dans le Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, qui peut être ajouté via les Datasources.", "it": "<u>Info:</u> Dopo aver inserito tutti i valori necessari, il consumo apparirà nel Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, che può essere aggiunto tramite Datasources.", "es": "<u>Info:</u> Después de completar todos los valores necesarios, el consumo aparecerá en el Datapoint <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, que se puede agregar a través de Datasources.", "pl": "<u>Informacje:</u> Po wprowadzeniu wszystkich niezbędnych wartości zużycie pojawi się w punkcie danych <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, który można dodać za pomocą źródeł danych.", "uk": "<u>Інформація:</u> після заповнення всіх необхідних значень споживання з’явиться в точці даних <code>energiefluss.Instance-No#.calculation.consumption.consumption</code>, яку можна додати через джерела даних.", "zh-cn": "<u>信息：</u>填写所有必要的值后，消耗将出现在数据点<code>energiefluss.Instance-No#.calculation.conspiration.conclusion</code>中，可以通过数据源添加。"},
    "help_preserveAspectRatio": {                     "en": "<p>The preserveAspectRatio attribute indicates how an element with a viewBox providing a given aspect ratio must fit into a viewport with a different aspect ratio.</p><p>Please refer to <a href='https://www.kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> to read more about</p>", "de": "<p>Das Attribut „preserveAspectRatio“ gibt an, wie ein Element mit einer ViewBox, die ein bestimmtes Seitenverhältnis bereitstellt, in ein Ansichtsfenster mit einem anderen Seitenverhältnis passen muss.</p><p>Bitte beachten Sie <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN-Webdokumente</a>, um mehr darüber zu erfahren</p>", "ru": "<p>Атрибут saveAspectRatio указывает, как элемент с viewBox, предоставляющим заданное соотношение сторон, должен вписываться в область просмотра с другим соотношением сторон.</p><p>См. <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>веб-документы MDN</a>, чтобы узнать больше</p>", "pt": "<p>O atributo preserveAspectRatio indica como um elemento com uma viewBox fornecendo uma determinada proporção deve caber em uma viewport com uma proporção diferente.</p><p>Consulte <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> para ler mais sobre</p>", "nl": "<p>Het preserveAspectRatio-attribuut geeft aan hoe een element met een viewBox die een bepaalde aspectverhouding biedt, moet passen in een viewport met een andere aspectverhouding.</p><p>Raadpleeg <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> om meer over te lezen</p>", "fr": "<p>L'attribut preserveAspectRatio indique comment un élément avec une viewBox fournissant un rapport d'aspect donné doit s'adapter à une fenêtre avec un rapport d'aspect différent.</p><p>Veuillez vous référer à <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> pour en savoir plus</p>", "it": "<p>L'attributo preserveAspectRatio indica in che modo un elemento con un viewBox che fornisce un determinato formato deve inserirsi in un viewport con un formato diverso.</p><p>Fai riferimento a <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> per saperne di più</p>", "es": "<p>El atributo preserveAspectRatio indica cómo un elemento con un viewBox que proporciona una relación de aspecto determinada debe encajar en una ventana gráfica con una relación de aspecto diferente.</p><p>Consulte <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web Docs</a> para obtener más información</p>", "pl": "<p>Atrybut keepAspectRatio wskazuje, w jaki sposób element z elementem viewBox zapewniającym dany współczynnik proporcji musi pasować do widocznego obszaru o innym współczynniku proporcji.</p><p>Proszę zapoznać się z <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>Dokumenty internetowe MDN</a>, aby dowiedzieć się więcej</p>", "uk": "<p>Атрибут SaveAspectRatio вказує на те, як елемент із viewBox із заданим співвідношенням сторін має вписуватися у вікно перегляду з іншим співвідношенням сторін.</p><p>Будь ласка, зверніться до <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>веб-документи MDN</a>, про які можна дізнатися більше</p>", "zh-cn": "<p>preserveAspectRatio 属性指示具有提供给定宽高比的 viewBox 的元素必须如何适应具有不同宽高比的视口。</p><p>请参阅 <a href='https://www. kreyenborg.koeln/efHelp-pAR' target='_blank'>MDN Web 文档</a>了解更多信息</p>"},
