    "no_ds_added": {                                  "en": "There are currently no Datasources added!",        "de": "Derzeit sind keine Datenquellen hinzugefügt!",     "ru": "В настоящее время нет добавленных источников данных!", "pt": "No momento, não há fontes de dados adicionadas!",  "nl": "Er zijn momenteel geen gegevensbronnen toegevoegd!", "fr": "Il n'y a actuellement aucune source de données ajoutée !", "it": "Al momento non sono state aggiunte origini dati!", "es": "¡Actualmente no hay fuentes de datos agregadas!",  "pl": "Obecnie nie dodano żadnych źródeł danych!",        "uk": "Наразі джерела даних не додано!",                  "zh-cn": "目前没有添加数据源！"},
    "ex_no_ds_added": {                               "en": "Go to the tab Datasources and add some",           "de": "Gehen Sie zur Registerkarte Datenquellen und fügen Sie einige hinzu", "ru": "Перейдите на вкладку Источники данных и добавьте некоторые", "pt": "Vá para a guia Datasources e adicione alguns",     "nl": "Ga naar het tabblad Gegevensbronnen en voeg er enkele toe", "fr": "Allez dans l'onglet Datasources et ajoutez quelques", "it": "Vai alla scheda Origini dati e aggiungine alcune", "es": "Vaya a la pestaña Fuentes de datos y agregue algunos", "pl": "Przejdź do zakładki Źródła danych i dodaj kilka",  "uk": "Перейдіть на вкладку Джерела даних і додайте їх",  "zh-cn": "转到“数据源”选项卡并添加一些"},
    "help_actions": {                                 "en": "<p><b>Toggle:</b><br>Toggles the current state (if state is off, turn it on - and vice versa)</p><p><b>On:</b><br>Sets the state always to true</p><p><b>Off:</b><br>Sets the state always to false</p>", "de": "<p><b>Umschalten:</b><br>Schaltet den aktuellen Status um (wenn der Status ausgeschaltet ist, schalten Sie ihn ein – und umgekehrt)</p><p><b>Ein:</b>< br>Setzt den Status immer auf wahr</p><p><b>Aus:</b><br>Setzt den Status immer auf falsch</p>", "ru": "<p><b>Переключатель:</b><br>переключает текущее состояние (если состояние выключено, включите его и наоборот)</p><p><b>Вкл.:</b>< br>Всегда устанавливает состояние в true</p><p><b>Выкл.:</b><br>Всегда устанавливает состояние в false</p>", "pt": "<p><b>Alternar:</b><br>Alterna o estado atual (se o estado estiver desativado, ative-o - e vice-versa)</p><p><b>Ativado:</b>< br>Define o estado sempre como verdadeiro</p><p><b>Desligado:</b><br>Define o estado sempre como falso</p>", "nl": "<p><b>Schakelen:</b><br>Hiermee schakelt u de huidige status in (als de status uit is, schakelt u deze in - en vice versa)</p><p><b>Aan:</b>< br>Zet de status altijd op true</p><p><b>Uit:</b><br>Zet de status altijd op false</p>", "fr": "<p><b>Basculer :</b><br> Bascule l'état actuel (si l'état est désactivé, activez-le - et vice versa)</p><p><b>Activé :</b>< br>Définit toujours l'état sur vrai</p><p><b>Désactivé :</b><br>Définit toujours l'état sur faux</p>", "it": "<p><b>Attiva/disattiva:</b><br>attiva/disattiva lo stato corrente (se lo stato è disattivato, attivalo e viceversa)</p><p><b>On:</b>< br>Imposta lo stato sempre su true</p><p><b>Off:</b><br>Imposta lo stato sempre su false</p>", "es": "<p><b>Alternar:</b><br>Alterna el estado actual (si el estado está desactivado, actívelo y viceversa)</p><p><b>Activado:</b>< br>Establece el estado siempre en verdadero</p><p><b>Desactivado:</b><br>Establece el estado siempre en falso</p>", "pl": "<p><b>Przełącz:</b><br>Przełącza bieżący stan (jeśli stan jest wyłączony, włącz go — i odwrotnie)</p><p><b>Włącz:</b>< br>Ustawia stan zawsze na true</p><p><b>Wyłączone:</b><br>Ustawia stan zawsze na false</p>", "uk": "<p><b>Перемикати:</b><br>перемикає поточний стан (якщо стан вимкнено, увімкніть його – і навпаки)</p><p><b>Увімкнено:</b>< br>Встановлює для стану завжди значення true</p><p><b>Вимк.:</b><br>встановлює для стану завжди значення false</p>", "zh-cn": "<p><b>切换：</b><br>切换当前状态（如果状态关闭，则将其打开 - 反之亦然）</p><p><b>打开：</b>< br>将状态始终设置为 true</p><p><b>关闭：</b><br>将状态始终设置为 false</p>"},
    "help_organize": {                                "en": "<p>All elements are organized in groups (rectangles and circles, icons, texts, etc.).</p> <p>Each item in each group can be brought to the foreground and background. Texts and icons are generally in the foreground of the other elements.</p>", "de": "<p>Alle Elemente sind in Gruppen organisiert (Rechtecke und Kreise, Symbole, Texte usw.).</p> <p>Jedes Element in jeder Gruppe kann in den Vordergrund und Hintergrund gebracht werden. Generell stehen Texte und Icons im Vordergrund der anderen Elemente.</p>", "ru": "<p>Все элементы организованы в группы (прямоугольники и круги, значки, тексты и т. д.).</p> <p>Каждый элемент в каждой группе можно вывести на передний или задний план. Тексты и значки обычно находятся на переднем плане других элементов.</p>", "pt": "<p>Todos os elementos são organizados em grupos (retângulos e círculos, ícones, textos, etc.).</p> <p>Cada item em cada grupo pode ser trazido para o primeiro plano e segundo plano. Textos e ícones geralmente estão no primeiro plano dos outros elementos.</p>", "nl": "<p>Alle elementen zijn georganiseerd in groepen (rechthoeken en cirkels, pictogrammen, teksten, etc.).</p> <p>Elk item in elke groep kan naar de voor- en achtergrond worden gebracht. Teksten en pictogrammen staan ​​over het algemeen op de voorgrond van de andere elementen.</p>", "fr": "<p>Tous les éléments sont organisés en groupes (rectangles et cercles, icônes, textes, etc.).</p> <p>Chaque élément de chaque groupe peut être mis au premier plan et en arrière-plan. Les textes et les icônes sont généralement au premier plan des autres éléments.</p>", "it": "<p>Tutti gli elementi sono organizzati in gruppi (rettangoli e cerchi, icone, testi, ecc.).</p> <p>Ogni elemento in ogni gruppo può essere portato in primo piano e sullo sfondo. I testi e le icone sono generalmente in primo piano rispetto agli altri elementi.</p>", "es": "<p>Todos los elementos se organizan en grupos (rectángulos y círculos, iconos, textos, etc.).</p> <p>Cada elemento de cada grupo se puede colocar en primer plano y en segundo plano. Los textos e íconos generalmente están en primer plano de los otros elementos.</p>", "pl": "<p>Wszystkie elementy są zorganizowane w grupy (prostokąty i koła, ikony, teksty itp.).</p> <p>Każdy element w każdej grupie można przenieść na pierwszy plan i tło. Teksty i ikony są zazwyczaj na pierwszym planie innych elementów.</p>", "uk": "<p>Усі елементи організовано в групи (прямокутники та кола, піктограми, тексти тощо).</p> <p>Кожен елемент у кожній групі можна вивести на передній план або на задній план. Тексти та піктограми зазвичай розташовані на передньому плані інших елементів.</p>", "zh-cn": "<p>所有元素都按组进行组织（矩形和圆形、图标、文本等）。</p> <p>每个组中的每个项目都可以显示在前景和背景中。文本和图标通常位于其他元素的前景中。</p>"},
